INSERT INTO `forestry_type` (`id`, `name`, `description`) VALUES
	(1, '六角大红', '&nbsp;&nbsp;我国华东地区的传统品种之一，又称"松阳红"。小乔木状。树冠开张，不正形，树条披斜至下垂。花大红色，花瓣有70～80枚，呈6～7轮排列，中心花瓣偶现白条，中型花，直径7～8厘米，呈放射六角状，完全重瓣型；叶倒卵形，较大，叶尾较长，叶缘锯齿粗稀而浅，主脉明显，侧脉间隔明显；长势旺，开张；花期晚。\n<br>&nbsp;&nbsp;红红的花朵饱含着浓浓的诗，浓浓的诗里蕴藏着喜悦的美。六角大红花绚丽，绵绵情悠悠！<br><img src="/forestry/static/img/upload/201407/20140717103207453819.jpg" border="0" height="300" width="400"><br>'),
	(2, '克瑞墨大牡丹', '&nbsp;&nbsp;花鲜艳的红色，芳香，牡丹型，大型花，最大花径可达13cm，外轮花瓣宽大，先端近圆形，略波浪状，内部花瓣直立，呈牡丹状，少量金黄色雄蕊夹杂在花瓣之间，花朵稀疏。叶片浓绿色，椭圆形，叶脉清晰，先端叶齿明显，植株紧凑，生长旺盛，花期中。\n<br>&nbsp;&nbsp;花色鲜艳红牡丹，芳香扑鼻随风来。特别是在晴日的和煦春风中，迎风舞动的绚丽花朵，阵阵馨香，陶然自怡。<br><img src="/forestry/static/img/upload/201407/20140717103318359258.jpg" border="0"><br>'),
	(3, '越南抱茎茶', '&nbsp;&nbsp;分布在越南北部与我国云南河口接壤的地区。本原种花粉红色，泛紫色调，单瓣型至半重瓣型，小到中型花，萼片绿色，花瓣8～13枚，宽圆，排列有序，边缘内卷，肥厚肉质，花心雄蕊散生，花药金黄色，花丝粉红色，花朵稠密。叶片浓绿色，椭圆形，长15～40cm，宽6～10cm，厚革质，基部包茎，叶脉明显，植株立性，生长旺盛。花期夏季至秋季，甚至全年开花。是培育四季开花的优良亲本。<br>&nbsp;&nbsp;花粉紫色，花瓣厚，花型像海棠。叶浓绿色，长而宽，外观非茶花。夏季酷暑盛开花，一年四季常有花。花朵稠密叶片美，观花观叶需要它。<br><img src="/forestry/static/img/upload/201407/20140717103437937597.jpg" border="0"><br>'),
	(4, '烈香', '&nbsp;&nbsp;花淡粉红色，花瓣边缘粉色略深，极芳香，牡丹型，中型花，大花瓣30枚左右，波浪状，小花瓣约10枚，与少量金黄色雄蕊混生，花朵稠密。叶片淡绿色，基部近卵圆形，先端尾尖，叶齿钝，植株开张，生长旺盛。花期中至晚。<br>&nbsp;&nbsp;粉嫩的花，粉嫩的容。溢浓浓芳香，看蜂歌蝶舞。在这美丽的春天，分享多彩生活。<br><img src="/forestry/static/img/upload/201407/20140717103456156307.jpg" border="0"><br>'),
	(5, '十八学士', '&nbsp;&nbsp;十八学士是茶花中的一个珍品，深为人们所厚爱。金庸在小说中曾描述过此花，可见其珍贵。它树型优美，枝条直立，幼枝深褐色。叶片深绿，富光泽。单花顶生，着花量多，花开树冠内外。重瓣型，花瓣层次分明，排列有序，十分美观。常见的花色有朱红、绯红、粉红、全白诸色，都是单色系的。<br>&nbsp;&nbsp;十八学士有红十八学士、花十八学士和白十八学士三个品种。<br>&nbsp;&nbsp;十八学士三姊妹，争相盛开，竞芳容。朵朵小巧又细腻、秀雅的花朵，完美无缺，百看不厌，系我国传统茶花名种之精品也。<br><img src="/forestry/static/img/upload/201407/20140717103514578615.jpg" border="0"><br>'),
	(6, '金花茶', '&nbsp;&nbsp;金花茶是一种古老的植物，极为罕见，分布极其狭窄，全世界90%的野生金花茶仅分布于我国广西防城港市十万大山的兰山支脉一带，生长于海拔700米以下，以海拔200-500米之间的范围较常见，垂直分布的下限为海拔20米左右。与银杉、桫椤、珙桐等珍贵“植物活化石”齐名，是我国八种国家一级保护植物之一，属《濒危野生动植物种国际贸易公约》附录Ⅱ中的植物种，国外称之为神奇的东方魔茶，被誉为“茶族皇后”。 1960年，我国科学工作者首次在广西南宁一带发现了一种金黄色的山茶花，被命名为金花茶，金花茶的发现轰动了全球园艺界、新闻界，受了国内外园艺学家的高度重视。认为它是培育金黄色山茶花品种的最优良原始材料。<br>&nbsp;&nbsp;金花茶花蜡黄色，单瓣型，其花梗下垂，形态美观。金瓣玉蕊，蜡质金黄，晶莹光洁，高贵雅致。金花茶是世界花坛中唯一具有金黄色花瓣，被誉为“世界珍品、茶族皇后”，象征着幸运、财富与健康。叶片浓绿色，椭圆形，中脉凹陷，边缘有锯齿，植株立性，生长旺盛。花期冬季到春季。<br><img src="/forestry/static/img/upload/201407/20140717103533031828.jpg" border="0"><br>'),
	(7, '张氏红山茶', '&nbsp;&nbsp;张氏红山茶又叫杜鹃红山茶，或“假大头茶”， 栽培上也称为“杜鹃茶”，属于山茶属，是常绿小乔木。张氏红山茶是一个极其珍稀的山茶品种，目前全世界仅在广东省阳春县鹅凰嶂省级自然保护区内发现，我国特有种。<br>&nbsp;&nbsp;花鲜艳的红色，单瓣型，中到大型花，萼片绿色，花瓣5-9枚，倒卵形，先端略凹，雄蕊基部连生呈管状，花丝红色，花药金黄色，花朵稠密，可结果实，蜡烛状的花蕾顶生或腋生。叶片浓绿色，狭倒卵形，革质，叶面光亮碧绿，边缘和叶面光滑；叶片在枝条上半直立，似杜鹃树的叶片。树体呈矮冠状，枝条光滑，嫩梢红色，枝叶密、紧凑。花期夏季至秋季，有时全年开花。是不可多得的培育四季开花的育种亲本。<br>&nbsp;&nbsp;花艳蕾丽四季盛开皆是春，株健叶亮八方花迷齐称绝。奇特山茶一鸣惊人天下知，观花观叶育新种首屈一指。<br><img src="/forestry/static/img/upload/201407/20140717103556687409.jpg" border="0"><br>'),
	(8, '南山茶', '&nbsp;&nbsp;广东省西南部的广宁、清远、德庆、信宜一带以及广西壮族自治区的东南部，海拔250～500米。南山茶是一种具有明显主干的小乔木，叶片漂亮，闪闪发亮，叶脉凹陷。花朵硕大，花径有8.0-10.5厘米，红色，但是植株间变异很大，花冠多为半开放，单花顶生或腋生。蒴果卵球形，挂在树枝上似苹果，甚是漂亮。南山茶叶片和花朵很漂亮，是亚热带地区园林绿化树种的上品。<br><img src="/forestry/static/img/upload/201407/20140717103615640930.jpg" border="0"><br>'),
	(9, '并蒂嫦娥', '&nbsp;&nbsp;花粉红色，两个花心，有时3-4个，完全重瓣型，花径有6-10cm，花期中。叶片阔椭圆形，叶面平整，枝条开张，长势旺盛。此品种为从“嫦娥”上分离出的变种，因两朵花并蒂而生，故取并蒂嫦娥。<br><img src="/forestry/static/img/upload/201407/20140717103638234492.jpg" border="0"><br><img src="/forestry/static/img/upload/201407/20140717103647546014.jpg" border="0"><br>'),
	(10, '小桃红', '&nbsp;&nbsp;小桃红别名叫“春雨”、“宫粉”、“广东粉”，在日本叫“乙女”，在西方国家叫“Pink Perfection”(粉十全十美)。<br>&nbsp;&nbsp;花桃粉红色，具光泽，完全重瓣型，小型花，花瓣60-90枚，卵圆形，先端圆，排列整齐，隐约可见较深的细脉纹，花量大。叶片浓绿色，椭圆形，中等大小，侧脉清晰，厚质，幼芽绿色，植株开张，生长旺盛。花期早至晚。<br>&nbsp;&nbsp;浙江平湖茶花诗人陆明望先生有感本品种写道：“桃红月貌美如仙，海外侨商佩胸前。玛瑙珍珠垂泪咽，茶花沸腾贵人间。”的确如此，早花国庆开，晚花至春末，一树小桃红，花意表真情。<br><img src="/forestry/static/img/upload/201407/20140717103737703392.jpg" border="0"><br>'),
	(11, '金盘荔枝', '&nbsp;&nbsp;我国华东和四川一带，别名“元宝”、“金盘托荔”、“铁壳宝珠”、“大红宝珠”等。<br>&nbsp;&nbsp;花大红色，略有蜡质感，托桂型，中型花，外轮大花瓣宽圆，呈盘状排列，先端略凹，花心雄蕊密集呈球状，有少量白斑，偶有金黄色雄蕊混生，花蕾萼片褐色，花量中等。叶片浓绿色，椭圆形，厚质，叶脉有明显，嫩芽、嫩叶、嫩枝及叶柄均为紫红色，植株紧凑，生长旺盛。花期中至晚。<br>&nbsp;&nbsp;大瓣托小瓣，红红密密的，盛花时节像闪闪红星。那是含笑传神的眼睛，缀在我们的心幕上，饱含着对我国传统品种的感情。<br><img src="/forestry/static/img/upload/201407/20140717103759093418.jpg" border="0"><br>'),
	(12, '冬星', '&nbsp;&nbsp;花粉红色，单瓣至半重瓣，中型花，单瓣型，花瓣6枚，长圆形，平铺，边缘略皱褶或波浪状，排列似星状，花心有雄蕊，花药橘红色，花朵稠密。叶片浓绿色，小椭圆形，植株半开张，生长中等。花期中。<br><img src="/forestry/static/img/upload/201407/20140717103834468990.jpg" border="0"><br>'),
	(13, '红露珍', '&nbsp;&nbsp;红露珍原产我国华东一带。花深红色，牡丹型，中到大型花，外轮大花瓣1-2轮，边缘波浪状，中心花瓣半直立，不规则扭曲，呈牡丹状，有金黄色雄蕊混生，花量中等。花期早至中。叶绿色，边缘下卷，长势旺，可以做嫁接茶花的砧木，是优良的园艺品种。做行道树开花时甚是壮观。从该品种上分离出花露珍和彩叶红露珍。<br><img src="/forestry/static/img/upload/201407/20140717103904015839.jpg" border="0"><br>'),
	(14, '黑牡丹', '&nbsp;&nbsp;花粉红色至红色，半重瓣，中型花，花期中至晚。叶背及幼枝有绒毛。<br><img src="/forestry/static/img/upload/201407/20140717103925234138.jpg" border="0"><br>'),
	(15, '粉芙蓉', '&nbsp;&nbsp;花粉红色，托桂型至牡丹型，外轮花瓣宽大，内轮花瓣直立，部分雄蕊瓣化，偶见黄色雄蕊，中型花，花期中至晚。<br><img src="/forestry/static/img/upload/201407/20140717103949671669.jpg" border="0"><br>'),
	(16, '紫金冠', '&nbsp;&nbsp;花暗红色，托桂至牡丹型，外轮花瓣宽大，内轮花瓣细碎直立，中型花，花朵稠密。花期中至晚。<br><img src="/forestry/static/img/upload/201407/20140717104008890012.jpg" border="0"><br>'),
	(17, '红十样锦', '&nbsp;&nbsp;花粉红色泛紫色调，花瓣略皱折，边缘内卷，花瓣中间点缀金黄色的雄蕊，俏皮可爱。半重瓣至牡丹型，大型花,花期中至晚。叶片绿色，枝条半开张，长势旺。<br><img src="/forestry/static/img/upload/201407/20140717104038140016.jpg" border="0"><br>'),
	(18, '白雪塔', '&nbsp;&nbsp;“苎萝美人含笑靥，玉真妃子披冰纱。”清代吴照在诗中把白茶花喻为西施和杨贵妃。席慕容在《白色山茶花》中这样描述她对白茶花的感觉：“我每次走过一棵开花的树，都不得不惊讶与屏息于生命的美丽。”<br>&nbsp;&nbsp;白雪塔花色洁白如雪，花姿晶莹秀美，花韵高洁清雅，实为白茶花的极品，花瓣阔卵圆形，先端有小缺口，边缘略外翻，覆瓦状排列；花完全重瓣型，中型花，花期早至中；叶片绿色，先端略扭曲，植株长势中等。我国浙江、福建、江西、湖南一带品种。<br><img src="/forestry/static/img/upload/201407/20140717104101687363.jpg" border="0"><br>'),
	(19, '白五色芙蓉', '&nbsp;&nbsp;花白色为主，有时出现浅粉色、粉红色，一株多色，以为是嫁接了不同茶花品种，其实不然。花型也不只托桂型，还有牡丹型，多数雄蕊瓣化，花瓣姿态丰富，或直立或扭曲；叶片绿色，植株立性，生长中等。<br>&nbsp;&nbsp;这四朵花就是在一株树上拍到的，茶花很美吧，大自然是不是很神奇，赐予我们人类如多彩的茶花。<br><img src="/forestry/static/img/upload/201407/20140717104122937509.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717104136265915.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717104147125900.jpg" border="0"><br><img src="/forestry/static/img/upload/201407/20140717104158968808.jpg" border="0"><br>'),
	(20, '红皮糙果茶', '&nbsp;&nbsp;别名：克氏茶；山茶科山茶属常绿乔木，树形优美，由香港前林务监督于1903年在香港柏架山首次发现。其树皮橙红色；花大，白色；花期10~12月，硕果球形，铁锈色，果皮粗糙，且十分坚硬。喜温暖湿润气候；为优良的观茎、观花、观果、观姿植物，也是重要的油料植物。现被列为国家二级保护植物。<br><img src="/forestry/static/img/upload/201407/20140717104232500906.jpg" border="0"><br>'),
	(21, '四面景+金盘荔枝', '&nbsp;&nbsp;花色相同，花型不同的茶花嫁接于一株，浑然一体，很难分瓣，根据下面的描述，您能分瓣出哪枝是四面景，哪枝是金盘荔枝吗？<br>&nbsp;&nbsp;四面景：花红色，牡丹型，花瓣卷曲，瓣间金黄色雄蕊象捉迷藏的孩子，闪现其中，惹人爱，中型花，花期中至晚。<br>&nbsp;&nbsp;金盘荔枝：花大红色，略有蜡质感，托桂型，中型花，外轮大花瓣宽圆，呈盘状排列，先端略凹，花心雄蕊密集呈球状，有少量白斑，偶有金黄色雄蕊混生，花蕾萼片褐色，花量中等。叶片浓绿色，椭圆形，厚质，植株紧凑，生长旺盛。花期中至晚。<br><img src="/forestry/static/img/upload/201407/20140717104300500277.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717104320906776.jpg" border="0">'),
	(24, '山茶之都', '&nbsp;&nbsp;花粉红色，花瓣扭曲，花径达13cm，大型花，花型托桂型到牡丹型。叶绿色，叶脉明显，长势旺；开张；花期中。<br>&nbsp;&nbsp;花朵中微露的花蕊，引来蜂蝶无数，娇嫩花朵喜迎春，豪性绽放，蕊瓣互融，美妙胜过别的花。<br>&nbsp;&nbsp;本品种由美国加州M.Rowell先生从品种“道克”的实生苗中选育而得，1972年公布。<br><img src="/forestry/static/img/upload/201407/20140717104610828326.jpg" border="0"><br>'),
	(25, '荷花片', '&nbsp;&nbsp;花白色，带红色条斑，完全重瓣型，偶见花蕊，中型花。叶片绿色，椭圆形，植物立性，生长中等，花期中。<br><img src="/forestry/static/img/upload/201407/20140717104629140679.jpg" border="0"><br>'),
	(26, '大苞山茶', '&nbsp;&nbsp;花白色，有时瓣缘泛粉红色，花径看一看图片有多大，单花顶生。叶片长椭圆形，先端渐尖，基部圆形，长8.0-15.0厘米，宽2.0-5.5厘米，边缘具齿。乔木，高可达8米。本原种树形美观，叶片碧绿，花量大，耐阳性强，作为园林树种的应用有巨大的潜力。在香港特别行政区本原种的中文名为“葛量洪茶”。<br><img src="/forestry/static/img/upload/201407/20140717104646984666.jpg" border="0"><br>'),
	(27, '阳春红', '&nbsp;&nbsp;花粉紫色，偶有白班，托桂型至牡丹型，小型花，花期早，并且花量大。植株半开张，生长中等。<br><img src="/forestry/static/img/upload/201407/20140717104709171021.jpg" border="0"><br>'),
	(28, '革命旗', '&nbsp;&nbsp;花红色，偏粉；牡丹型，花瓣皱褶，似绢花；中型花；花期中；植物立性；生长中等。<br><img src="/forestry/static/img/upload/201407/20140717104729687091.jpg" border="0"><br>'),
	(29, '通草片', '&nbsp;&nbsp;花浅粉红色，瓣缘色深，中央花瓣细碎，完全重瓣型，中型花。花期中，植株立性。<br><img src="/forestry/static/img/upload/201407/20140717104749750295.jpg" border="0"><br>'),
	(30, '朱砂莲', '&nbsp;&nbsp;花红色，泛紫色调，完全重瓣型，中型花。花期中，植株立性，长势中等。<br><img src="/forestry/static/img/upload/201407/20140717104810562378.jpg" border="0"><br>'),
	(31, '六角白', '&nbsp;&nbsp;花纯白色，花瓣呈六角，完全重瓣型，中型花，花期晚，植株立性，生长慢。<br><img src="/forestry/static/img/upload/201407/20140717104830578881.jpg" border="0"><br>'),
	(32, '天鹅湖', '&nbsp;&nbsp;花纯白色，花瓣基部泛淡黄色调，牡丹型，大型花，花期早。植物株半开张，生长慢。<br><img src="/forestry/static/img/upload/201407/20140717104847968298.jpg" border="0"><br>'),
	(33, '红露珍+紫金冠', '&nbsp;&nbsp;红露珍原产我国华东一带。花深红色，牡丹型，中到大型花，外轮大花瓣1-2轮，边缘波浪状，中心花瓣半直立，不规则扭曲，呈牡丹状，有金黄色雄蕊混生，花量中等。<br>&nbsp;&nbsp;紫金冠，花暗红色，托桂至牡丹型，外轮花瓣宽大，内轮花瓣细碎直立，中型花，花朵稠密。花期中至晚。<br>&nbsp;&nbsp;一株两个品种，你能通过描述找到哪个是红露珍，哪个是紫金冠吗？<br><img src="/forestry/static/img/upload/201407/20140717104909593829.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717104917671410.jpg" border="0">'),
	(34, '达婷', '&nbsp;&nbsp;花紫红色，玫瑰重瓣型至牡丹型，大型花，花瓣宽圆，排列松散，瓣面可见清晰深红色脉纹，花心偶有小花瓣出现和金黄色雄蕊外露，花朵稠密。植物开张，生长旺盛。花期早至晚。<br><img src="/forestry/static/img/upload/201407/20140717104943031272.jpg" border="0"><br>'),
	(35, '埃尔西朱瑞', '&nbsp;&nbsp;花活泼的粉红色，略泛紫色调，牡丹型，大至巨型花，最大花径可达14厘米。植物开张，生长慢，花期中至晚。<br><img src="/forestry/static/img/upload/201407/20140717105003703743.jpg" border="0"><br>'),
	(36, '凹脉金花茶+金花茶', '&nbsp;&nbsp;这两个金花茶共性都开黄色的花，但花大小不同，色泽也有区别。凹脉金花茶听名字就知叶脉凹于叶面，蕾比花的观赏性还要强，花小。金花茶花大，通过这个性状，现在是不是能区分出两种金花茶了吧。<br><img src="/forestry/static/img/upload/201407/20140717105028187669.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717105035578676.jpg" border="0">'),
	(37, '黛比+冬星', '&nbsp;&nbsp;通过叶片和花你能分辨出这一株有几个茶花品种吗？没分出来也没关系，下面的解释会帮助你认识它们。黛比：花深粉红色，泛紫色调，牡丹型，外轮大花瓣，中部大小花瓣混生，象个绣球，中到大型花。叶片有些发黄，如果认为它生长不良，那你就错了，那是它本色。梦船：花粉红色，单瓣型，中型花，花心有雄蕊，花朵稠密。植物半开张，生长中等。花期中。<br><img src="/forestry/static/img/upload/201407/20140717105059312322.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717105115968487.jpg" border="0">'),
	(38, '克瑞墨+帕克斯+玛丽安', '&nbsp;&nbsp;克瑞墨曾介绍过，让我们认识其他两个品种。帕克斯是美国帕克斯先生培育出的一个杂交种。花艳红色，牡丹型，巨型花，最大花径可达15厘米，花瓣宽大，波浪状并略扭曲，花心偶见金黄色雄蕊混生。叶片波绿，叶片粗糙，叶缘锯齿粗。植物半开张，生长旺盛。玛丽安，花红色，具清香气味，托桂型至牡丹型，中到大型花，外轮花瓣宽圆，略呈波浪状，中部花瓣直立扭曲，象个绣球。三个红色的茶花同时开放，你能辨别出来吗？<br><img src="/forestry/static/img/upload/201407/20140717105142734321.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717105150515707.jpg" border="0"><img src="/forestry/static/img/upload/201407/20140717105157953660.jpg" border="0">'),
	(39, '加勒比松', '&nbsp;&nbsp;这些加勒比松是嫁接的，长到这么粗壮高大，能猜出长了多少年。加勒比松，别名古巴松，树干通直，自然整枝能力强，是良好的风景林和用材林。在它下面种植茶花，就是利用它宽大的冠幅为茶花遮蔽烈日。<br><img src="/forestry/static/img/upload/201407/20140717105216937885.jpg" border="0"><br>'),
	(40, '凤凰木', '&nbsp;&nbsp;取名于“叶如飞凰之羽，花若丹凤之冠”。别名金凤花、红花楹树、火树、洋楹等，凤凰木因鲜红或橙色的花朵配合鲜绿色的羽状复叶，被誉为世上最色彩鲜艳的树木之一。它是非洲马达加斯加共和国的国树、厦门市、台湾台南市、四川攀枝花市的市树,民国时期广东湛江市的市花。凤凰木植株高大，可达20公尺以上。由于树冠横展而下垂，浓密阔大而招风，在热带地区担任遮荫树的角色。性喜高温、多日的环境，必须在阳光充足处方能繁茂生长。分布于中国南部及西南部、原产地马达加斯加及世界各热带地方。我们就是利用它阔大的树冠来为茶花遮荫。<br><img src="/forestry/static/img/upload/201407/20140717105231203294.jpg" border="0"><br>'),
	(41, '毛桃木莲', '&nbsp;&nbsp;&nbsp; 毛桃木莲为木兰科木莲属常绿大乔木，因其花、果倒挂于植株枝头，又名垂果木莲。树形挺拔秀丽，树叶秀美奇特，花大芳香。毛桃木莲因具有观花、观叶和赏果的效果，是绿化、美化环境和庭园观赏的理想树种。<br>&nbsp;&nbsp;&nbsp; 在春风的滋润下，生长的嫩枝、嫩叶，在阳光照射下熠熠生辉，充满着生机和活力。初夏在绿叶丛中，当花朵缓缓绽开时，宛如一朵朵倒挂的“莲花”，一阵阵沁人心脾的芳香，从刚刚绽放的花朵中逸出。金秋时节，果实成熟，卵圆形的，果黄中透红，在绿叶丛中缀满枝头。<br><img src="http://localhost:8080/forestry/static/img/upload/201508/20150820132847609655.jpg" height="313" border="0" width="471"><br>');
